import { Header } from "../Header/Header.js";
import "./Home.css";

const Home = () => {
    return (
        <div id={ "home" }>
            <Header siteName={ "Domov" } />
            <div className={ "div first" }>
                <h1 className={ "secondary-title" } id={ "title" }>Chceš sa naučiť programovať?</h1>
            </div>
            <div className={ "div" }>
                <img
                    src={ "https://thumbor.forbes.com/thumbor/960x0/https%3A%2F%2Fblogs-images.forbes.com%2Fforbestechcouncil%2Ffiles%2F2019%2F01%2Fcanva-photo-editor-8-7.jpg" }
                    alt={ "Coding preview" }
                    className={ "second-image" }
                />
                <p className={ "second-text" }>
                    Chceš sa naučiť programovať? Tak tento kurz je presne pre teba!
                    Na tomto kurze sa naučíš základy programovania a aj niake programovacie jazyky.
                </p>
            </div>
        </div>
    )
}

export { Home };
